$.i18n.init(
    resGetPath: 'locales/__lng__.json',
    load: 'unspecific',
    fallbackLng: false,
    lng: 'en'
}, function (t)
    $('.i18_links').i18n();
});</pre>

                    <h3>Step 4</h3>
                    <p>
                        After that if you want to change the language you just need to add buttons and fire the i18n.setLng() function.
                    </p>

                    <div class=""row"">
                        <div class=""col-md-6"">
                            <h4>
                                HTML markup
